import Header from './header'
import style from './index.module.css'


function sendForm() {
    
}

function Contato() {
    return (
    <div>
        <style jsx global>{`
            * {
                margin: 0;
                padding: 0;
                box-sizing: border-box;
            }
        `}</style>
        <Header></Header>
        <form onSubmit={()=>sendForm()}>
            <input type="text" />
            <input type="submit" />
        </form>
    </div>)
}
  
export default Contato
